    public DungeonLevel3() {
        for (int[] row : map) {
            if (row.length != MAP_WIDTH) {
                throw new IllegalStateException("All rows must have " + MAP_WIDTH + " columns.");
            }
        }
        
        specialLocations.put(new Point(98, 2), LocationType.STAIRS_UP);
        // Add more as needed
    }
    
